(1, 1, 'سياسة الخصوصية', 'privacy policy', 'show', '2024-07-25 13:40:50', '2025-05-26 07:42:19', 'الاتةنسمو', 'hvshbmklc,', 'privacy-policy'),
(2, 1, 'شرح آليات النظام', 'شرح آليات النظام', 'show', '2024-08-17 13:14:27', '2025-05-26 07:42:18', '<p>شرح آليات النظام لموقع العقارات </p><p>نظام الموقع يعمل من خلال عدد من الآليات المتكاملة التي تهدف إلى تسهيل إضافة العقارات، مشاركة العقارات، التوثيق، والمزايدات. هذه الآليات تضمن سير العمل بشكل منظم وآمن.</p><h5 class=\"\"><b>إضافة العقارات</b></h5><p>اختيار نوع العقار: عند التسجيل في الموقع أو الدخول إلى الحساب الشخصي، يختار المستخدم نوع العقار الذي يود إضافته (بيع، إيجار، مزايدة، مشاركة).</p><p><span style=\"color: rgb(33, 37, 41);\">إدخال تفاصيل العقار: بعد اختيار نوع العقار، يتم إدخال التفاصيل الخاصة به مثل العنوان، المساحة، المميزات، الصور، الفيديوهات (إن وجدت)، والسعر. التوثيق: يتم توثيق العقار من خلال إرسال مستندات رسمية أو استخدام وسيلة توثيق مثل مسح QR Code</span></p><p><span style=\"color: rgb(33, 37, 41);\">أو إرسال رسالة عبر البريد الإلكتروني أو التطبيق. هذا التوثيق يضمن أن العقار المدخل حقيقي ويخص المالك.</span></p><h5 class=\"\"><b>المزايدات والمشاركة</b></h5><p> المزايدة على العقار: في حالة المزايدات، يمكن للمستخدمين الذين يرغبون في شراء العقار تقديم عروض أسعار. وتتم العملية من خلال إدخال المبلغ الذي يريدون دفعه.</p><p><span style=\"color: rgb(33, 37, 41);\">المشاركة في العقار: يمكن للمستخدمين المشاركة في عقار عن طريق المساهمة بمبلغ معين من المال لزيادة فرص شراء العقار معًا. يجب أن يكون للمشارك في العقار إمكانية متابعة الحالة والردود الخاصة بالمشاركة.</span></p><h5 class=\"\"><b>التوثيق وإرسال الخطابات</b></h5><p> الخطابات: بعد إضافة العقار وتوثيقه، يستطيع المستخدم إرسال خطاب رسمي لعرضه على المالك أو الوكيل. الخطاب يحتوي على تفاصيل العقار والطلب المقدم من المستخدم (سواء كان عرض شراء أو مساهمة أو مزايدة).</p><p><span style=\"color: rgb(33, 37, 41);\">حالات الخطاب:</span></p><p><span style=\"color: rgb(33, 37, 41);\">قبول الخطاب: عند قبول الخطاب، يتم تعديل حالة العقار ويتم التواصل بين الطرفين بشكل رسمي.</span></p><p><span style=\"color: rgb(33, 37, 41);\">رفض الخطاب: في حالة رفض الخطاب، لا يتم اتخاذ أي إجراء بخصوص العقار المقدم.</span></p><p><span style=\"color: rgb(33, 37, 41);\">رد على الخطاب: يمكن للمالك الرد على الخطاب بمستند رسمي يوضح موقفه من العرض المقدم.</span></p><h5 class=\"\"><b>التحقق من العقار والتوثيق الرسمي</b><span style=\"color: rgb(33, 37, 41); font-size: 16px;\"><br></span></h5><h5 class=\"\"><span style=\"color: rgb(33, 37, 41); font-size: 16px;\">إجراءات التوثيق: يقوم المستخدم بإدخال البيانات اللازمة للعقار وإرفاق الوثائق الرسمية مثل (عقد الملكية، صورة البطاقة الشخصية، أو أي مستندات تثبت ملكيته للعقار).</span></h5><p><span style=\"color: rgb(33, 37, 41);\">التوثيق عبر QR Code: يمكن استخدام QR Code لتوثيق العقار بشكل أسهل. يتم إنشاء رمز QR يربط بين العقار والمستندات الرسمية، مما يجعل التوثيق أكثر دقة وأمانًا.</span></p><h5 class=\"\"><b>إشعارات المستخدمين</b></h5><p><span style=\"color: rgb(33, 37, 41);\">إشعار عند إضافة عقار: عندما يقوم المستخدم بإضافة عقار جديد، يتلقى إشعارًا يفيد بأنه تم إضافة العقار بنجاح. </span></p><p><span style=\"color: rgb(33, 37, 41);\">إشعار عند رد على خطاب: عندما يتلقى المستخدم ردًا على خطاب أرسله (قبول، رفض، أو رد تفصيلي)، يتم إرسال إشعار له لمتابعة التحديثات. </span></p><p><span style=\"color: rgb(33, 37, 41);\">إشعار عند مزايدة أو مشاركة: عندما يشارك المستخدم في عقار أو يزايد عليه، يتم إرسال إشعار له بخصوص أي تحديثات على حالته أو المزايدة. </span></p><h5 class=\"\"><b>التفاعلات بين المستخدمين </b></h5><p><span style=\"color: rgb(33, 37, 41);\">إدارة الحساب الشخصي: كل مستخدم يمكنه إدارة حسابه الخاص على الموقع من خلال إضافة أو تعديل العقارات التي يملكها أو التي شارك فيها. يتم التحكم في جميع البيانات من خلال واجهة المستخدم الشخصية. </span></p><p><span style=\"color: rgb(33, 37, 41);\">التفاعل مع العقارات: بعد إضافة عقار، يتمكن المستخدم من التفاعل معه عن طريق إرسال خطاب، المزايدة عليه، أو المشاركة فيه. كما يمكنه متابعة حالته من خلال لوحة التحكم. </span></p><p><span style=\"color: rgb(33, 37, 41);\">إدارة الحسابات والإشراف مراقبة الحسابات: المسؤولون عن الموقع يقومون بمراقبة الأنشطة على العقارات من حيث التوثيق والمزايدات لضمان الشفافية والعدالة. </span></p><p><span style=\"color: rgb(33, 37, 41);\">الإشراف على العقارات: يمكن للموقع تقديم إشراف شامل على جميع العقارات المتاحة من حيث توثيقها وتحديثاتها. يساعد هذا في ضمان صحة المعلومات المعروضة على الموقع وحمايته من المحتويات غير القانونية.</span></p>', 'شرح آليات النظام شرح آليات النظام شرح آليات النظام شرح آليات النظام', 'return-policy'),
