(80, 'landing', 'beneficiaries_text_en', 0, '\"<div class=\\\"beneficiaries\\\">\\r\\n  <div class=\\\"beneficiary mb-4\\\">\\r\\n    <div class=\\\"beneficiary-name d-flex align-items-center gap-2 mb-2\\\">\\r\\n      <i class=\\\"fa-solid fa-star\\\"><\\/i>\\r\\n      <h5 class=\\\"fw-bold m-0\\\">Property Owners<\\/h5>\\r\\n    <\\/div>\\r\\n    <div class=\\\"beneficiary-desc\\\">\\r\\n      <p>\\r\\n        Property owners are individuals who own real estate and list it for sale or rent on the website. They can benefit from the platform by marketing their properties, obtaining official verification, and increasing their chances of selling or renting through paid promotion or urgent verification services.\\r\\n      <\\/p>\\r\\n    <\\/div>\\r\\n  <\\/div>\\r\\n\\r\\n  <div class=\\\"beneficiary mb-4\\\">\\r\\n    <div class=\\\"beneficiary-name d-flex align-items-center gap-2 mb-2\\\">\\r\\n      <i class=\\\"fa-solid fa-star\\\"><\\/i>\\r\\n      <h5 class=\\\"fw-bold m-0\\\">Buyers and Renters<\\/h5>\\r\\n    <\\/div>\\r\\n    <div class=\\\"beneficiary-desc\\\">\\r\\n      <p>\\r\\n        These are individuals looking to buy or rent properties. They can use the platform to find listings that meet their needs using filters and advanced search, in addition to ensuring property credibility through official verification.\\r\\n      <\\/p>\\r\\n    <\\/div>\\r\\n  <\\/div>\\r\\n\\r\\n  <div class=\\\"beneficiary mb-4\\\">\\r\\n    <div class=\\\"beneficiary-name d-flex align-items-center gap-2 mb-2\\\">\\r\\n      <i class=\\\"fa-solid fa-star\\\"><\\/i>\\r\\n      <h5 class=\\\"fw-bold m-0\\\">Real Estate Agents<\\/h5>\\r\\n    <\\/div>\\r\\n    <div class=\\\"beneficiary-desc\\\">\\r\\n      <p>\\r\\n        Agents are intermediaries who help property owners sell or rent their real estate. They can use the platform to showcase properties and expand their client base. They can also benefit from urgent verification services and improve the visibility of the properties they manage.\\r\\n      <\\/p>\\r\\n    <\\/div>\\r\\n  <\\/div>\\r\\n\\r\\n  <div class=\\\"beneficiary mb-4\\\">\\r\\n    <div class=\\\"beneficiary-name d-flex align-items-center gap-2 mb-2\\\">\\r\\n      <i class=\\\"fa-solid fa-star\\\"><\\/i>\\r\\n      <h5 class=\\\"fw-bold m-0\\\">Banks and Financial Institutions<\\/h5>\\r\\n    <\\/div>\\r\\n    <div class=\\\"beneficiary-desc\\\">\\r\\n      <p>\\r\\n        Banks and financial institutions collaborate with the real estate platform to offer mortgage services to buyers and renters. These institutions can use the available information on the platform to identify suitable properties for their clients.\\r\\n      <\\/p>\\r\\n    <\\/div>\\r\\n  <\\/div>\\r\\n<\\/div>\"', '2024-12-08 09:28:24', '2025-05-26 07:57:32'),
